import React from 'react'
import { Navbar } from 'react-bootstrap'

function Browse() {
    const randomJobs = [1,2,3,4];
  return (
    <div>
        <Navbar />
        <div>
            <div>
                <h6>Search Results (randomJobs.le)</h6>
            </div>
        </div>
    </div>
  )
}

export default Browse
